module.exports = {
  root: true,
  env: {
    node: true,
    browser: true,
    es6: true,
  },
  extends: ['eslint:recommended', 'prettier'],
  plugins: ['html', 'prettier'],
  rules: {
    'prettier/prettier': ['error', {}, { usePrettierrc: true }],
  },
};

module.exports = {
  // 一行最多 120 字符
  printWidth: 120,
  // 使用 2 个空格缩进
  tabWidth: 2,
  // 不使用缩进符，而使用空格
  useTabs: false,
  // 行尾需要有分号
  semi: true,
  // 使用单引号
  singleQuote: true,
  // 对象的 key 仅在必要时用引号
  quoteProps: 'as-needed',
  // jsx 不使用单引号，而使用双引号
  jsxSingleQuote: false,
  // 末尾需要有逗号
  trailingComma: 'all',
  // 大括号内的首尾需要空格
  bracketSpacing: true,
  // 箭头函数，只有一个参数的时候，也需要括号
  arrowParens: 'always',
  // 每个文件格式化的范围是文件的全部内容
  rangeStart: 0,
  rangeEnd: Infinity,
  // 不需要写文件开头的 @prettier
  requirePragma: false,
  // 不需要自动在文件开头插入 @prettier
  insertPragma: false,
  // 使用默认的折行标准
  proseWrap: 'preserve',
  // 根据显示样式决定 html 要不要折行
  htmlWhitespaceSensitivity: 'css',
  // vue 文件中的 script 和 style 内不用缩进
  vueIndentScriptAndStyle: false,
  // 换行符使用 lf
  endOfLine: 'lf',
};

module.exports = {
  extends: ['stylelint-config-standard', 'stylelint-config-standard-less'],
  rules: {
    'number-leading-zero': 'never',
    'color-function-notation': 'legacy',
    'alpha-value-notation': 'number',
    // TODO 后面统一改 class 小写 且 BEM，当前按警告提示
    'selector-class-pattern': [
      '^[a-z]+([-]?[a-z0-9]+)*(__[a-z0-9]([-]?[a-z0-9]+)*)?(--[a-z0-9]([-]?[a-z0-9]+)*)?$',
      {
        resolveNestedSelectors: true,
        message: 'Expected class selector "%s" to be lowercase and BEM format',
        severity: 'warning',
      },
    ],
    'media-feature-range-notation': 'prefix',
  },
};

{
  "private": true,
  "scripts": {
    "preinstall": "npx -y only-allow pnpm",
    "dev:components": "pnpm run --filter 'tdesign-site-components' dev",
    "dev:site": "pnpm run build:components && pnpm run --filter 'tdesign-site' dev",
    "dev:theme-generator": "pnpm run --filter 'tdesign-theme-generator' dev",
    "build:components": "pnpm run --filter 'tdesign-site-components' build && pnpm run --filter 'tdesign-site-components' postbuild",
    "build:theme-generator": "pnpm run --filter 'tdesign-theme-generator' build",
    "build-watch:theme-generator": "pnpm run --filter 'tdesign-theme-generator' build:watch",
    "site": "npm run build:components && cd site && npm run build",
    "site:intranet": "npm run build:components && cd site && npm run site:intranet",
    "site:preview": "npm run build:components && cd site && npm run site:preview",
    "auto-release": "pnpm run --filter 'tdesign-auto-release' start",
    "prepare": "husky install"
  },
  "license": "MIT",
  "dependencies": {
    "prismjs": "^1.29.0"
  },
  "devDependencies": {
    "@commitlint/cli": "^8.2.0",
    "@commitlint/config-conventional": "^8.2.0",
    "cz-conventional-changelog": "^3.0.2",
    "eslint": "^7.32.0",
    "eslint-config-prettier": "^9.0.0",
    "eslint-config-recommended": "^4.1.0",
    "eslint-plugin-html": "^7.1.0",
    "eslint-plugin-prettier": "^5.0.0",
    "husky": "^8.0.0",
    "lint-staged": "8.1.5",
    "prettier": "^2.8.8",
    "rimraf": "^3.0.2",
    "stylelint": "^15.10.3",
    "stylelint-config-standard": "^34.0.0",
    "stylelint-config-standard-less": "^2.0.0"
  },
  "engines": {
    "pnpm": ">=9.0.0"
  },
  "config": {
    "commitizen": {
      "path": "./node_modules/cz-conventional-changelog"
    }
  },
  "lint-staged": {
    "*.{vue,js,html}": [
      "eslint --fix",
      "prettier --write",
      "git add"
    ],
    "*.{less,css}": [
      "stylelint --fix",
      "git add"
    ]
  }
}
